import React from 'react';
import Link from 'next/link'
import Route from 'next/router'

const HomePage = () => {
    return (
        <div>
            This is home page 2
            <Link href="/auth">Auth</Link>
            <button onClick={()=> Route.push("/auth")}>Auth Route</button>
        </div>
    );
};

export default HomePage;
